import { Injectable } from '@angular/core';
import { State, Action, StateContext } from '@ngxs/store';
import { SetUser, SetToken } from './auth.actions';

export interface AuthStateModel {
  user?: any;
  token: string;
}

@State<AuthStateModel>({
  name: 'auth',
  defaults: {
    user: null,
    token: null,
  },
})
@Injectable()
export class AuthState {
  constructor() {}
  @Action(SetUser)
  setUser({ patchState }: StateContext<AuthStateModel>, { payload }: SetUser) {
    patchState({ user: payload });
  }

  @Action(SetToken)
  setToken({ patchState }: StateContext<AuthStateModel>, { payload }: SetToken) {
    patchState({ token: payload });
  }
}

export interface LocalIcon {
  name: string;
  url: string;
  iconPath: string;
}

export const FOOTER_ICONS: LocalIcon[] = [
  {
    name: 'facebook',
    url: 'www.facebook.com',
    iconPath: 'assets/icons/social-media/facebook.svg',
  },
  {
    name: 'instagram',
    url: 'www.instagram.com',
    iconPath: 'assets/icons/social-media/instagram.svg',
  },
  {
    name: 'linkedin',
    url: 'www.linkedin.com',
    iconPath: 'assets/icons/social-media/linkedin.svg',
  },
];

export interface LoginFormValues {
  email: string;
  password: string;
}

export interface SignUpFormValues {
  email: string;
  password: string;
  'password confirm': string;
  'first and last name': string;
  phone: string;
  'birth date': string;
}

